import React from "react";
import { FaHiking, FaCity, FaLandmark, FaSpa, FaUmbrellaBeach, FaGift, FaCampground, FaUsers } from "react-icons/fa";

function Activities() {
  return (
    <div className="bg-white rounded-lg p-4 px-20 flex flex-col justify-between mb-6">
      <h2 className="text-3xl font-bold text-gray-700 italic mb-6 flex items-center">
        <span className="text-blue-700 mr-6">ðŸ§­</span> Browse Tours By Activity
      </h2>
      
      <ul className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-4 text-gray-800 text-lg leading-relaxed">
        <li className="flex items-center gap-3"><FaHiking className="text-blue-500" /> Outdoor Activities</li>
        <li className="flex items-center gap-3"><FaCity className="text-blue-500" /> City Tours</li>
        <li className="flex items-center gap-3"><FaLandmark className="text-blue-500" /> Cultural & Thematic Tours</li>
        <li className="flex items-center gap-3"><FaSpa className="text-blue-500" /> Indulgence & Luxury Tours</li>
        <li className="flex items-center gap-3"><FaUsers className="text-blue-500" /> Family Friendly Tours</li>
        <li className="flex items-center gap-3"><FaUmbrellaBeach className="text-blue-500" /> Relaxation Tours</li>
        <li className="flex items-center gap-3"><FaGift className="text-blue-500" /> Holiday & Seasonal Tours</li>
        <li className="flex items-center gap-3"><FaCampground className="text-blue-500" /> Wild & Adventure Tours</li>
      </ul>
    </div>
  );
}

export default Activities;
